import { APP_ROUTES } from "src/utils/constants";
import { Title, Wrap, SvgWrapper, CardImg, Container } from "./styled";
import { useNavigate } from "react-router-dom";
import { ICatalog } from "src/utils/interfaces/catalog.interface";
import { Catalog } from "../../../assets/index";
import { Text } from "src/commonStyles";

interface Props {
  catalogCard: ICatalog;
}

export default function CatalogCard(props: Props) {
  const navigate = useNavigate();

  return (
    <Wrap
      onClick={() =>
        navigate(
          `${APP_ROUTES.CATALOG}/${props.catalogCard.name.split(" ").join("-")}`
        )
      }
    >
      {/* <SvgWrapper>{getImg()}</SvgWrapper> */}
      <CardImg
        $background={
          props.catalogCard.imgUrl ||
          "https://static.vecteezy.com/system/resources/previews/004/493/181/original/hospital-building-for-healthcare-background-illustration-with-ambulance-car-doctor-patient-nurses-and-medical-clinic-exterior-free-vector.jpg"
        }
      />
      <Container>
        <Text $height="45px" $width="650px">
          {props.catalogCard.name}
        </Text>
        <Text $height="145px" $width="650px">
        {props.catalogCard.name}
        </Text>
      </Container>
      {/* <Title>{props.catalogCard.nameRu}</Title> */}
    </Wrap>
  );
}
